import React from 'react';
import styled from 'styled-components'

const background = styled.div`
    position: fixed;
    top: 0%; 
    left:50%;
    right: 50%;
    height: 50px;
    width: 100%;
    background-color: 'red';
`

function ToolBar() {
    return(
        <background>
            Hello World
        </background>
    )
}

export default ToolBar;
